        "fct-descr": "\u003cp\u003eEvents.  Semantically: time-ordered list of future values.\n Instances: \n\u003c/p\u003e\u003cul\u003e\u003cli\u003e \u003ccode\u003eMonoid\u003c/code\u003e: \u003ccode\u003emempty\u003c/code\u003e is the event that never occurs, and \u003ccode\u003ee \u003ccode\u003emappend\u003c/code\u003e\n   e'\u003c/code\u003e is the event that combines occurrences from \u003ccode\u003ee\u003c/code\u003e and \u003ccode\u003ee'\u003c/code\u003e.\n\u003c/li\u003e\u003cli\u003e \u003ccode\u003e\u003ca\u003eFunctor\u003c/a\u003e\u003c/code\u003e: \u003ccode\u003efmap f e\u003c/code\u003e is the event that occurs whenever \u003ccode\u003ee\u003c/code\u003e occurs,\n   and whose occurrence values come from applying \u003ccode\u003ef\u003c/code\u003e to the values from\n   \u003ccode\u003ee\u003c/code\u003e.\n\u003c/li\u003e\u003cli\u003e \u003ccode\u003eApplicative\u003c/code\u003e: \u003ccode\u003epure a\u003c/code\u003e is an event with a single occurrence at time\n   -Infinity.  \u003ccode\u003eef \u003c*\u003e ex\u003c/code\u003e is an event whose occurrences are made from\n   the \u003cem\u003eproduct\u003c/em\u003e of the occurrences of \u003ccode\u003eef\u003c/code\u003e and \u003ccode\u003eex\u003c/code\u003e.  For every occurrence\n   \u003ccode\u003ef\u003c/code\u003e at time \u003ccode\u003etf\u003c/code\u003e of \u003ccode\u003eef\u003c/code\u003e and occurrence \u003ccode\u003ex\u003c/code\u003e at time \u003ccode\u003etx\u003c/code\u003e of \u003ccode\u003eex\u003c/code\u003e, \u003ccode\u003eef\n   \u003c*\u003e ex\u003c/code\u003e has an occurrence \u003ccode\u003ef x\u003c/code\u003e at time \u003ccode\u003etf \u003ccode\u003e\u003ca\u003emax\u003c/a\u003e\u003c/code\u003e tx\u003c/code\u003e.  N.B.: I\n   don't expect this instance to be very useful.  If \u003ccode\u003eef\u003c/code\u003e has \u003ccode\u003enf\u003c/code\u003e\n   instances and \u003ccode\u003eex\u003c/code\u003e has \u003ccode\u003enx\u003c/code\u003e instances, then \u003ccode\u003eef \u003c*\u003e ex\u003c/code\u003e has \u003ccode\u003enf*nx\u003c/code\u003e\n   instances.  However, there are only \u003ccode\u003enf+nx\u003c/code\u003e possibilities for \u003ccode\u003etf\n   \u003ccode\u003e\u003ca\u003emax\u003c/a\u003e\u003c/code\u003e tx\u003c/code\u003e, so many of the occurrences are simultaneous.  If you think\n   you want to use this instance, consider using \u003ccode\u003eReactive\u003c/code\u003e instead.\n\u003c/li\u003e\u003cli\u003e \u003ccode\u003e\u003ca\u003eMonad\u003c/a\u003e\u003c/code\u003e: \u003ccode\u003ereturn a\u003c/code\u003e is the same as \u003ccode\u003epure a\u003c/code\u003e (as usual).  In \u003ccode\u003ee \u003e\u003e= f\u003c/code\u003e,\n   each occurrence of \u003ccode\u003ee\u003c/code\u003e leads, through \u003ccode\u003ef\u003c/code\u003e, to a new event.  Similarly\n   for \u003ccode\u003ejoin ee\u003c/code\u003e, which is somehow simpler for me to think about.  The\n   occurrences of \u003ccode\u003ee \u003e\u003e= f\u003c/code\u003e (or \u003ccode\u003ejoin ee\u003c/code\u003e) correspond to the union of the\n   occurrences (temporal interleaving) of all such events.  For example,\n   suppose we're playing Asteroids and tracking collisions.  Each collision\n   can break an asteroid into more of them, each of which has to be tracked\n   for more collisions.  Another example: A chat room has an \u003cem\u003eenter\u003c/em\u003e event,\n   whose occurrences contain new events like \u003cem\u003espeak\u003c/em\u003e.  An especially useful\n   monad-based function is \u003ccode\u003ejoinMaybes\u003c/code\u003e, which filters a Maybe-valued\n   event.\n\u003c/li\u003e\u003c/ul\u003e",
        "fct-module": "FRP.Reactive",
        "fct-package": "reactive",
